import "./App.css";
import React, { Component, Fragment } from "react";
import Navbar from "./components/layout/Navbar";
import PropTypes from "prop-types";

class App extends Component {

  static propTypes = {
    title: PropTypes.string.isRequired,
  };

  render() {
    const name = "Simon";

    return (
      <Fragment>
        <Navbar title="Hello" />
        <h1>Hello {name}</h1>
      </Fragment>
    );
  }
}

export default App;
